import React from 'react';
import Button from '@material-ui/core/Button';


export const Buttons  = ({texto="btn" , color="secondary", onGenerar}) => {
            

    return(
        <Button variant="contained" onClick={onGenerar} color={color}>
            {texto}
       </Button>
    )
}
